import React from "react";
import classes from './Results.module.css';

const Results = (props) => {

    const onRowClickHandler = (id,title,vote) => {
        console.log(`captured title`, title);
    };

  return (
    <table>
      <thead>
        <tr>
          <th>id</th>
          <th>title</th>
          <th>vote</th>
        </tr>
      </thead>

      <tbody>
        {props.results.map((result) => (
          <tr className={classes.tr} onClick={onRowClickHandler.bind(result.id, result.title, result.vote_average)}>
            <td>{result.id}</td>
            <td>{result.title}</td>
            <td>{result.vote_average}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Results;
